import styled from "styled-components";
import BottomNavBar from "../../components/shared/BottomNavBar";
import {
  Container,
  MainBtn,
  ProcedureHeading,
  SelectionBox,
  SpaceForNavBar,
} from "../../Styles";

interface Props {}

export default function BookingPage(props: Props) {
  return (
    <Container>
      <Heading>막걸리 찬가 놀러가기!</Heading>
      <SelectionBox>
        <SelectionMainText></SelectionMainText>
      </SelectionBox>
      <SelectionBox></SelectionBox>
      <MainBtn>놀러가기</MainBtn>
      <BottomNavBar selectedItem="feed" />
    </Container>
  );
}

const Heading = styled(ProcedureHeading)`
  padding-top: 50px;
  margin-left: 30px;
  margin-bottom: 30px;
`;
